import Header from "../components/header.js";
import Footer from "../components/Footer.js";

export default function Contact() {
  return (
    <div class="subpage-background">
      <Header />
      <div class="section">
        <div class="content-wrapper w-container">
          <h1 class="page-title">Get in touch</h1>
          <div class="div-block-5">
            <h3 class="heading-4">Social Media</h3>
            <div class="text-block contact-text">Facebook Instagram etc</div>
            <h3 class="heading-4">Phone</h3>
            <div class="text-block-2 contact-text">317-490-8135</div>
            <h3 class="heading-4">Email</h3>
            <div class="text-block-3 contact-text">daveemail@gmail.com</div>
          </div>
        </div>
      </div>
      <Footer />
      <style jsx>
        {`
          subpage-background {
            height: 100vh;
          }
        `}
      </style>
    </div>
  );
}

